import React, { useState } from 'react';

// Define or import your custom components
const Button = ({ onClick, children, variant, size, ...props }) => {
  const baseStyles = "px-4 py-2 font-semibold rounded";
  const variantStyles = variant === "secondary" ? "bg-gray-500 text-white" : "bg-blue-500 text-white";
  const sizeStyles = size === "sm" ? "text-sm" : "text-base";

  return (
    <button 
      onClick={onClick} 
      className={`${baseStyles} ${variantStyles} ${sizeStyles}`}
      {...props}
    >
      {children}
    </button>
  );
};

// Tabs component definitions
const Tabs = ({ value, onValueChange, className, children }) => {
  return (
    <div className={className}>
      {children}
    </div>
  );
};

const TabsList = ({ className, children }) => {
  return (
    <div className={className}>
      {children}
    </div>
  );
};

const TabsTrigger = ({ value, onTabChange, children, activeTab }) => {
  return (
    <button
      className={`w-full p-2 ${activeTab === value ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
      onClick={() => onTabChange(value)}
    >
      {children}
    </button>
  );
};

const TabsContent = ({ value, activeTab, children }) => {
  return (
    <div className={`p-4 ${activeTab === value ? 'block' : 'hidden'}`}>
      {children}
    </div>
  );
};

// Main component
export default function CareerNavigator() {
  const [activeTab, setActiveTab] = useState('job-roles');

  return (
    <div className="flex flex-col min-h-screen">
      <header className="flex items-center justify-between p-4 bg-primary text-primary-foreground">
        <h1 className="text-2xl font-bold">Career Navigator</h1>
        <nav className="flex items-center space-x-4">
          <span className="font-medium">John Doe</span>
          <Button variant="secondary" size="sm">Profile</Button>
        </nav>
      </header>

      <main className="flex-grow p-6">
        <section className="max-w-4xl mx-auto">
          <Tabs value={activeTab} onValueChange={setActiveTab} className="w-full">
            <TabsList className="w-full grid grid-cols-2">
              <TabsTrigger value="job-roles" onTabChange={setActiveTab} activeTab={activeTab}>
                Job Role Recommendations
              </TabsTrigger>
              <TabsTrigger value="skill-navigator" onTabChange={setActiveTab} activeTab={activeTab}>
                Skill Navigator
              </TabsTrigger>
            </TabsList>
            <TabsContent value="job-roles" activeTab={activeTab}>
              <JobRecommendations />
            </TabsContent>
            <TabsContent value="skill-navigator" activeTab={activeTab}>
              <SkillNavigator />
            </TabsContent>
          </Tabs>
        </section>
      </main>

      <div className="fixed bottom-4 right-4">
        <Button size="icon" className="rounded-full w-12 h-12">
          <MessageCircle className="h-6 w-6" />
          <span className="sr-only">Open chatbot</span>
        </Button>
      </div>
    </div>
  );
}
